import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 32, height: 32, viewBox: "0 0 32 32", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M12.22 4.46A3.5 3.5 0 007 7.51V24.5a3.5 3.5 0 005.23 3.04l15-8.5a3.5 3.5 0 000-6.08l-15-8.5z", fill: primaryFill }));
};
const Play32Filled = wrapIcon(rawSvg({}), 'Play32Filled');
export default Play32Filled;
